# internal :

def moving_average(a, n):
    ret = np.cumsum(a)
    ret[n:] = ret[n:] - ret[:-n]
    a = np.empty(n-1)
    a.fill(-1)
    return np.concatenate((a, ret[n - 1:] / n))


